import React from 'react';
import logo from './logo.svg';
import './App.css';

let array = []

function pupulateArray(num) {
  for(let i = 1; i < num; i++) {
    array.push(i)
  }
}
pupulateArray(20)
const grid = array.map(item => <div className={`div div${item}`}></div>)

function App() {
  return (
    <div className="App">
      {grid}
    </div>
  );
}

export default App;
